### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Asymptotic Notation and Complexity Analysis**
- **Big-O Notation (O):** Describes the upper bound of an algorithm's running time.
  - \( f(n) = O(g(n)) \) if there exist constants \( c \) and \( n_0 \) such that \( f(n) \leq c \cdot g(n) \) for all \( n \geq n_0 \).
- **Time Complexity:** Analysis of the time taken by an algorithm to run, based on the input size.
  - Examples: \( O(n^2) \), \( O(n \log n) \), \( O(n^2 \log n) \).

#### 2. **Sorting Algorithms**
- **Merge Sort:**
  - **Time Complexity:** \( O(n \log n) \) for worst, best, and average cases.
  - **Recurrence Relation:** \( T(n) = 2T(n/2) + O(n) \).
  - **Stability:** Merge sort is a stable sorting algorithm.
- **Insertion Sort:**
  - **Time Complexity:** \( O(n^2) \) for worst and average cases, \( O(n) \) for the best case.
  - **Stability:** Insertion sort is a stable sorting algorithm.
- **Quick Sort:**
  - **Time Complexity:** \( O(n \log n) \) for average case, \( O(n^2) \) for the worst case.
  - **Pivot Selection:** The choice of pivot affects the performance; the first element is used as the pivot in the given code.

#### 3. **Data Structures**
- **Linked Lists:**
  - **Operations:** Insertion and deletion at the front, end, or specific positions.
  - **Time Complexity:** Constant time for front operations, linear time for end operations.
- **Stacks and Queues:**
  - **Operations:** Push, pop (for stacks); enqueue, dequeue (for queues).
  - **Time Complexity:** Constant time for basic operations.
- **Hash Tables:**
  - **Collision Resolution:** Linear probing is a method to resolve collisions.
  - **Hash Function:** \( \text{hash\_index} = \text{key} \mod \text{table\_size} \).

#### 4. **Graph Theory**
- **Graph Representations:**
  - **Adjacency Matrix:** \( O(n^2) \) space complexity.
  - **Adjacency List:** \( O(n + m) \) space complexity.
- **Graph Traversal:**
  - **Breadth-First Search (BFS):** Explores all neighbors at the present depth before moving on to nodes at the next depth level.
  - **Depth-First Search (DFS):** Explores as far as possible along each branch before backtracking.
- **Topological Sorting:**
  - **Definition:** Linear ordering of vertices such that for every directed edge \( u \rightarrow v \), vertex \( u \) comes before \( v \).
  - **Applications:** Scheduling, dependency resolution.

#### 5. **Graph Properties**
- **Degree Sequence:** A sequence of the degrees of the vertices of a graph.
- **Maximum Number of Edges:** For an undirected graph with \( n \) vertices, the maximum number of edges is \( \frac{n(n-1)}{2} \).

#### 6. **Unimodal Lists**
- **Definition:** A list that consists of a decreasing sequence followed by an increasing sequence.
- **Finding Minimum:** Can be found in \( O(\log n) \) time using binary search techniques.

